The six faces of a three-inch wooden cube are each painted red. The cube is then cut into one-inch cubes along the lines shown in the diagram. How many of the one-inch cubes have red paint on at least one face? [asy]

pair A,B,C,D,E,F,G;

pair a,c,d,f,g,i,j,l,m,o,p,r,s,u,v,x,b,h;

A=(0.8,1);
B=(0,1.2);
C=(1.6,1.3);
D=(0.8,0);
E=B-(A-D);
F=C-(A-D);
G=B+(C-A);

draw(E--D--F--C--G--B--A--D);
draw(A--C); draw(E--B);

a=(1/3)*D+(2/3)*E;
c=(2/3)*D+(1/3)*E;
p=(1/3)*A+(2/3)*B;
r=(2/3)*A+(1/3)*B;

draw(a--p);
draw(c--r);

v=(1/3)*B+(2/3)*E;
x=(2/3)*B+(1/3)*E;
b=(1/3)*A+(2/3)*D;
h=(2/3)*A+(1/3)*D;

draw(v--b);
draw(x--h);

s=(1/3)*C+(2/3)*A;
u=(2/3)*C+(1/3)*A;
d=(1/3)*F+(2/3)*D;
f=(2/3)*F+(1/3)*D;

draw(s--d);
draw(f--u);

g=(1/3)*C+(2/3)*F;
i=(2/3)*C+(1/3)*F;

draw(i--h);
draw(g--b);

m=(1/3)*B+(2/3)*G;
o=(2/3)*B+(1/3)*G;

draw(m--u);
draw(o--s);

j=(1/3)*G+(2/3)*C;
l=(2/3)*G+(1/3)*C;

draw(l--p);
draw(r--j);

[/asy]

The foci of the ellipse $\frac{x^2}{49} + \frac{y^2}{33} = 1$ are $F_1$ and $F_2,$ as shown below.  Let $P$ be a point on the circle $x^2 + (y - 2)^2 = 4.$  Line $F_2 P$ intersects the ellipse again at $Q,$ where the $y$-coordinate of $Q$ is positive.  Find the maximum value of $PQ + F_1 Q.$

[asy]
unitsize(0.4 cm);

pair P, Q;
pair[] F;

path ell = yscale(sqrt(33))*xscale(7)*Circle((0,0),1);
F[1] = (4,0);
F[2] = (-4,0);
P = (0,3) + 2*dir(240);
Q = intersectionpoint(P--interp(F[2],P,5),ell);

draw(ell);
draw((-8,0)--(8,0));
draw((0,-7)--(0,7));
draw(Circle((0,3),2));
draw(F[1]--Q--F[2]);

dot("$F_1$", F[1], S);
dot("$F_2$", F[2], S);
dot("$P$", P, S);
label("$Q$", Q, NE);
[/asy]

